import React from 'react';

import Grid from './Grid';
import './Board.css';

function Board({ matrix }) {
  return (
    <div className="board">
      {matrix.map(row => (
        <div className="row">
          {row.map(grid =>
            <Grid enabled={grid.enabled} active={grid.active} />
          )}
        </div>
      ))}
    </div>
  );
}

export default Board;
